    private void cambiarFondo(String opcionFondo) {
        switch (opcionFondo) {
            case "Fondo Blanco":
                rootContainer.setStyle("-fx-background-color: white;");
                break;
            case "Fondo Azul Claro":
                rootContainer.setStyle("-fx-background-color: #e6f3ff;");
                break;
            case "Fondo Verde Claro":
                rootContainer.setStyle("-fx-background-color: #e6ffe6;");
                break;
            case "Fondo Gris":
                rootContainer.setStyle("-fx-background-color: #f0f0f0;");
                break;
        }
        System.out.println("Fondo cambiado a: " + opcionFondo);
    }

    public static void main(String[] args) {
        launch(args);
    }
